const int VIEW_SPLASHSCREEN_PALETTE[] = {15069655,14741455,13493681,12771232,10275684,9159498,16711421,14412999,12639901,11917451,11063928,10604141};

#define VIEW_SPLASHSCREEN_DOMINANT_COLOR 5

void
drawView_splashscreen() {

    int i = 0;
    int palette_size = sizeof(VIEW_SPLASHSCREEN_PALETTE) / sizeof(int);
    for (i = 0; i < palette_size; i++){
        ProgramPalette(i, VIEW_SPLASHSCREEN_PALETTE[i]);
    }

    /* 
     * Paint view w/ dominant color using hardware accelerated function to save time
     * - This allows us to call "WriteAPixel()" lesser amount of time.
     * - "WriteAPixel()" is a really slow function.
     */
    Rectangle(VIEW_POSITION_X, 
                VIEW_POSITION_Y, 
                VIEW_POSITION_X + VIEW_WIDTH, 
                VIEW_POSITION_Y + VIEW_HEIGHT, 
                VIEW_SPLASHSCREEN_DOMINANT_COLOR);

    int j = 0;
    for (j = 0; j < (VIEW_WIDTH * VIEW_HEIGHT); j++) {
        if (VIEW_SPLASHSCREEN_PIXELARRAY[j] == (char) VIEW_SPLASHSCREEN_DOMINANT_COLOR)
            continue;
        else
            WriteAPixel(VIEW_POSITION_X + (j % VIEW_WIDTH), VIEW_POSITION_Y + (j / VIEW_WIDTH), (int) VIEW_SPLASHSCREEN_PIXELARRAY[j]);
    }
}
